import React, {Component} from "react"

const divStyle = {
    background: "rgba(0, 0, 0, 1)"
}

const imgStyle = {
    marginTop: "2.4vh",
    marginLeft: "3vw",
    position: "absolute",
    height: "8vh",
}

const manStyle = {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    flexDirection: "column",
    marginLeft: "30vw",
    height: "12.8vh",
}

const nameStyle = {
    color: "rgba(82, 186, 0, 1)",
    fontFamily: "Roboto",
    fontStyle: "bold",
    marginLeft: "10px"
}

const userStyle = {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",

}

class Header extends Component {

    state = { name: this.props.name }
    
    render() {
        // const { name } = this.props
        console.log(this.props)
        return (
            <div style={divStyle}>
                <img style={imgStyle} src="./img/Vector.png" />
                <div style={userStyle}>
                    <div style={manStyle}>
                        <img src="./img/XMLID_792_.png" />
                        <img src="./img/XMLID_795_.png" />
                    </div>
                    <div style={nameStyle}>{name}</div>
                </div>
            </div>
        )
    }
};

export default Header;
